    private final Object[][] inputStacks;
    private final int width;
    private final int height;
    private final boolean copyNbt;

    private CraftingRecipe_v1_8(final Object[] outputStack, final int width, final int height, final boolean copyNbt, final Object[]... inputStacks) {
        this.outputStack = outputStack;
        this.inputStacks = inputStacks;
        this.width = width;
        this.height = height;
        this.copyNbt = copyNbt;

        CRAFTING_RECIPE_LIST.add(this);
    }

    private CraftingRecipe_v1_8(final Object[] outputStack, final Object[]... inputStacks) {
        this.outputStack = outputStack;
        this.inputStacks = inputStacks;
        this.width = -1;
        this.height = -1;
        this.copyNbt = false;

        CRAFTING_RECIPE_LIST.add(this);
    }

    public Object[] outputStack() {
        return this.outputStack;
    }

    public Object[][] inputStacks() {
        return this.inputStacks;
    }

    public int width() {
        return this.width;
    }

    public int height() {
        return this.height;
    }

    public boolean shouldCopyNbt() {
        return this.copyNbt;
    }

    public boolean isShapeless() {
        return this.width == -1 && this.height == -1;
    }

